import React from "react";
import styled from "styled-components";

const FooterContainer = styled.footer`
    background-color: #ddd;
    color: #333;
    width: 100%;
    height: 5%;
    position: absolute;
    top: -10%;
`;

const Footer = () => {
    return <FooterContainer>This is a footer.</FooterContainer>
}

export default Footer;
